import React, { Component } from 'react';
import {Text,View,Image} from 'react-native';

class Header1 extends Component {
  render() {
     return(
      <View styles ={{bakcgroundColor: '#000'}}>
        <View style={{ paddingVertical: 10}}>
          <Text style={{textAlign: 'center', fontWeight: 'bold', fontSize:18 }}>DATA COVID-19 Global & Indonesia</Text> 
        </View>
        <View style={{paddingVertical: 5}}>
        <Text style={{textAlign: 'center', fontWeight: 'bold', fontSize:18 }}>Global</Text>
        </View>
      </View> 
    )
  }
};

export default Header1;
